// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract PatientRecords {
    struct Patient {
        uint256 id;
        string name;
        string email;
        string gender;
        string bloodGroup;
        uint256 dob;
        string aadhaarCard;
        string ayushmanCard;
    }

    mapping(uint256 => Patient) private patients;
    uint256 private nextPatientId;
    mapping(address => bool) private authorizedDoctors;

    event PatientAdded(uint256 id, string name);
    event PatientUpdated(uint256 id, string name);

    modifier onlyAuthorizedDoctor() {
        require(authorizedDoctors[msg.sender], "Unauthorized access");
        _;
    }

    function addPatient(
        string memory _name,
        string memory _email,
        string memory _gender,
        string memory _bloodGroup,
        uint256 _dob,
        string memory _aadhaarCard,
        string memory _ayushmanCard
    ) public onlyAuthorizedDoctor {
        uint256 id = nextPatientId++;
        patients[id] = Patient(
            id,
            _name,
            _email,
            _gender,
            _bloodGroup,
            _dob,
            _aadhaarCard,
            _ayushmanCard
        );
        emit PatientAdded(id, _name);
    }

    function updatePatient(
        uint256 _id,
        string memory _name,
        string memory _email,
        string memory _gender,
        string memory _bloodGroup,
        uint256 _dob,
        string memory _aadhaarCard,
        string memory _ayushmanCard
    ) public onlyAuthorizedDoctor {
        Patient storage patient = patients[_id];
        require(patient.id == _id, "Patient not found");
        patient.name = _name;
        patient.email = _email;
        patient.gender = _gender;
        patient.bloodGroup = _bloodGroup;
        patient.dob = _dob;
        patient.aadhaarCard = _aadhaarCard;
        patient.ayushmanCard = _ayushmanCard;
        emit PatientUpdated(_id, _name);
    }

    function getPatient(uint256 _id) public view returns (Patient memory) {
        Patient storage patient = patients[_id];
        require(patient.id == _id, "Patient not found");
        return patient;
    }

    function authorizeDoctor(address _doctor) public onlyAuthorizedDoctor {
        authorizedDoctors[_doctor] = true;
    }

    function revokeDoctor(address _doctor) public onlyAuthorizedDoctor {
        authorizedDoctors[_doctor] = false;
    }
}
